About us:

Bulwork is the first IT recruitment agency in Bulgaria with 24 years of stable presence in the market. The company has established a reputation for delivering high-quality services to clients and candidates. We respect the candidates' wishes and strive to provide the best service by finding the most suitable and challenging job for them.

Our client:

It is a customer-first company that specializes in the technology sector. It is focused on providing flexible and affordable consulting services in web development and design, data analytics, and artificial intelligence (AI). For more than 15 years, the company has been working with fast-developing organizations across all industries and leveraging state-of-the-art technology to build, upgrade, and lift its clients' brands and online presence.

Due to some exciting projects ahead, the company is now looking to find and hire a talented and experienced IT Geek in the position of a:

MOBILE DEVELOPER (Flutter)

The role involves developing high-quality mobile applications using Flutter and taking responsibility for solution architecture, ensuring performance, security, and scalability improvements. It also includes contributing to the full product lifecycle, sharing knowledge through sessions, and fostering an open communication culture within the team.

Essential requirements for the role:
• 2+ years of experience with Flutter and Dart;
• Experience with Swift/iOS and/or Kotlin/Android;
• Experience with Unit and UI testing and a good understanding of Clean Architecture design patterns;
• Knowledge of GraphQL;
• Knowledge of Database operations on mobile devices and DI;
• English language (minimum B2 level - verbal and written communication).

The company can offer:
• Competitive salary;
• Opportunity to work FULLY REMOTELY!
• Standard but flexible working hours (Monday-Friday);
• Different team building events;
• Opportunities for professional growth and development;
• Become a part of a collaborative and friendly work environment;
• Opportunity to work on very interesting and high-impact projects.

If you're interested in this job opportunity, please don't hesitate and send us your CV in English or your LinkedIn profile!

The confidentiality of all applications is assured. Only short-listed candidates will be contacted.
The candidates do not pay any taxes to the agency – the services are FREE OF CHARGE.

